import React, {Component} from 'react';
import{
    Row, Col, Button, Container
}from "reactstrap"

class Profile extends Component {

    render(){
        const {pokemons} = this.props.pokemons
        return <Container>
            {
                 pokemons.map (po => (
                    <Row>
                    <Col md="6">
                        <img alt={po.name} src={po.sprites.front_default} />
                    </Col>
                    <Col md="6">
                        <ul>
                            <li>Id: {po.id}</li>
                            <li>Name: {po.name}</li>
                        </ul>
                    </Col>
                </Row>
            ))
            }
        </Container>
    }
};

export default Profile;
